Omar's student Stasia is really eager to learn how to play and she wants to practice constantly. But when Omar comes over for her piano lesson, he somehow finds that it's not piano she plays and practices with. He'll teach her what she wants of course as any good teacher would. So assfucking is the piece they will practice, and over and over until it's perfected!
